INSERT INTO `conversation_editor_chatline` (`id`, `message`, `created`, `updated`, `chat_id`, `created_user_id`, `label_id`, `parent_id`, `human`) VALUES
(22, 'Buna User', '2019-07-03 11:11:43.463000', '2019-07-03 11:11:43.463000', 22, 2, 1, NULL, 0),
(24, 'Cu ce te pot ajuta?', '2019-07-03 11:11:43.487000', '2019-07-03 11:11:43.487000', 22, 2, 8, 23, 0),
(23, 'Buna Oana', '2019-07-03 11:11:43.477000', '2019-07-03 11:11:43.477000', 22, 2, 1, 22, 1),
(4183, 'De cateva zile nu pot sa dorm. Stau cu ochii inchisi dar nu adorm.', '2019-07-04 07:56:37.568395', '2019-07-04 07:56:37.568395', 202, 2, 37, 4182, 1),
(4182, 'Te ascult, <NAME>.', '2019-07-04 07:56:37.558635', '2019-07-04 07:56:37.558635', 202, 2, 91, 4181, 0),
(4181, 'Buna ziua. Am o problema nasoala.', '2019-07-04 07:56:37.548875', '2019-07-04 07:56:37.548875', 202, 2, 1, 4180, 1),
(4180, 'Buna ziua! Ma numesc <NAMEBOT>. Cu ce informatii te pot ajuta azi?', '2019-07-04 07:56:37.539115', '2019-07-04 07:56:37.539115', 202, 2, 1, NULL, 0),
(4179, 'La revedere, <NAME>!', '2019-07-04 07:56:37.514715', '2019-07-04 07:56:37.514715', 201, 2, 28, 4178, 0),
(4178, 'La revedere!', '2019-07-04 07:56:37.498123', '2019-07-04 07:56:37.498123', 201, 2, 28, 4177, 1),
(4176, 'Ah, multumesc!', '2019-07-04 07:56:37.475675', '2019-07-04 07:56:37.475675', 201, 2, 2, 4175, 1),
(4177, 'Cu drag!', '2019-07-04 07:56:37.486411', '2019-07-04 07:56:37.486411', 201, 2, 2, 4176, 0),
(4175, 'Programarile se stabilesc telefonic.', '2019-07-04 07:56:37.462988', '2019-07-04 07:56:37.462988', 201, 2, 2, 4174, 0),
(4174, 'Cand pot sa ma duc?', '2019-07-04 07:56:37.452251', '2019-07-04 07:56:37.452251', 201, 2, 2, 4173, 1),
(4173, 'Acesta este voucher pentru clinicaxxxxx: voucherxxxxx . Sa iti fie de folos!', '2019-07-04 07:56:37.441515', '2019-07-04 07:56:37.441515', 201, 2, 50, 4172, 0),
(4172, 'Super! Mi-ar placea o reducere, te rog.', '2019-07-04 07:56:37.429803', '2019-07-04 07:56:37.429803', 201, 2, 87, 4171, 1),
(4171, 'Daca te intereseaza, pot sa iti ofer un voucher pentru reducere chiar acum.', '2019-07-04 07:56:37.418092', '2019-07-04 07:56:37.418092', 201, 2, 21, 4170, 0),
(4170, 'O sa ma gandesc.', '2019-07-04 07:56:37.405403', '2019-07-04 07:56:37.405403', 201, 2, 2, 4169, 1),
(4168, 'Da, cred ca e cazul sa merg.', '2019-07-04 07:56:37.383931', '2019-07-04 07:56:37.383931', 201, 2, 2, 4167, 1),
(4169, 'Daca imi permiti, recomand sa iti faci o programare la clinicaxxxxx.', '2019-07-04 07:56:37.393691', '2019-07-04 07:56:37.393691', 201, 2, 11, 4168, 0),
(4167, 'Cred ca cel mai indicat ar fi sa consulti un medic pentru asta.', '2019-07-04 07:56:37.368315', '2019-07-04 07:56:37.368315', 201, 2, 73, 4166, 0),
(4166, 'Multumesc dar ce pot sa fac pana atunci?', '2019-07-04 07:56:37.355627', '2019-07-04 07:56:37.355627', 201, 2, 2, 4165, 1),
(4165, 'S-ar putea ca pe site-ul nostru sa gasesti articole care abordeaza aceasta tema. Iti dau link pentru cand vrei sa te uiti: sitexxxxx', '2019-07-04 07:56:37.339035', '2019-07-04 07:56:37.339035', 201, 2, 12, 4164, 0),
(4164, 'Da dar nu mi-a dat nici un tratament. A spus ca sunt dureri reumatice si nu am ce sa fac.', '2019-07-04 07:56:37.327325', '2019-07-04 07:56:37.327325', 201, 2, 70, 4163, 1),
(4163, 'Ai fost la un consult pana acum?', '2019-07-04 07:56:37.314636', '2019-07-04 07:56:37.314636', 201, 2, 43, 4162, 0),
(4162, 'De mai mult timp si nu stiu cum sa scap de ea. Am folosit compres si creme pentru dureri articulare dar tot ma deranjeaza.', '2019-07-04 07:56:37.303429', '2019-07-04 07:56:37.304370', 201, 2, 25, 4161, 1),
(4161, 'De cat timp ai aceasta problema?', '2019-07-04 07:56:37.288754', '2019-07-04 07:56:37.288754', 201, 2, 43, 4160, 0),
(4160, 'Nu.', '2019-07-04 07:56:37.276066', '2019-07-04 07:56:37.276066', 201, 2, 26, 4159, 1),
(4159, 'Mai ai si alte simptome?', '2019-07-04 07:56:37.265330', '2019-07-04 07:56:37.265330', 201, 2, 43, 4158, 0),
(4158, 'Am dureri la glezna', '2019-07-04 07:56:37.253653', '2019-07-04 07:56:37.253653', 201, 2, 25, 4157, 1),
