(3171, 'Numai un doctor iti poate face o recomandare potrivita.', '2019-07-04 07:56:25.718574', '2019-07-04 07:56:25.718574', 158, 2, 73, 3170, 0),
(3170, 'Exista un tratament care ma poate ajuta acum?', '2019-07-04 07:56:25.708815', '2019-07-04 07:56:25.708815', 158, 2, 52, 3169, 1),
(3169, 'Desigur, te ascult.', '2019-07-04 07:56:25.698078', '2019-07-04 07:56:25.698078', 158, 2, 91, 3168, 0),
(3168, 'Multumesc, pot sa te mai intreb ceva?', '2019-07-04 07:56:25.687814', '2019-07-04 07:56:25.687814', 158, 2, 2, 3167, 1),
(3167, 'Iti pot recomanda clinicaxxxxx unde te poate trata un medic specializat.', '2019-07-04 07:56:25.678054', '2019-07-04 07:56:25.678054', 158, 2, 11, 3166, 0),
(3166, 'Nu. Doar o alifie. Ma dau cand ma doare, dar nu prea ma ajuta.', '2019-07-04 07:56:25.667318', '2019-07-04 07:56:25.667318', 158, 2, 70, 3165, 1),
(3165, 'Iei medicamente pentru aceasta problema?', '2019-07-04 07:56:25.657557', '2019-07-04 07:56:25.657557', 158, 2, 43, 3164, 0),
(3164, 'Cum adica?', '2019-07-04 07:56:25.646821', '2019-07-04 07:56:25.646821', 158, 2, 2, 3163, 1),
(3163, 'Te afli sub tratament medical?', '2019-07-04 07:56:25.637062', '2019-07-04 07:56:25.637062', 158, 2, 43, 3162, 0),
(3162, 'Nu, insa daca ma aplec durerea este mai intensa.', '2019-07-04 07:56:25.626326', '2019-07-04 07:56:25.626326', 158, 2, 70, 3161, 1),
(3161, 'Alte simptome ai?', '2019-07-04 07:56:25.616565', '2019-07-04 07:56:25.616565', 158, 2, 43, 3160, 0),
(3160, 'Nu inca. Imi este greu sa ma deplasez.', '2019-07-04 07:56:25.605830', '2019-07-04 07:56:25.605830', 158, 2, 2, 3159, 1),
(3159, 'Ai fost la un control pana acum, <NAME>?', '2019-07-04 07:56:25.590175', '2019-07-04 07:56:25.590175', 158, 2, 43, 3158, 0),
(3158, 'Am o durere puternica la coloana. Nu stiu ce am facut dar ma doare de doua zile.', '2019-07-04 07:56:25.579438', '2019-07-04 07:56:25.579438', 158, 2, 70, 3157, 1),
(3157, 'Ma numesc <NAMEBOT>. Cu ce te pot ajuta astazi?', '2019-07-04 07:56:25.569678', '2019-07-04 07:56:25.569678', 158, 2, 1, NULL, 0),
(3155, 'Mersi mult.', '2019-07-04 07:56:25.541374', '2019-07-04 07:56:25.541374', 157, 2, 2, 3154, 1),
(3156, 'Toate cele bune! La revedere, <NAME>!', '2019-07-04 07:56:25.551134', '2019-07-04 07:56:25.551134', 157, 2, 28, 3155, 0),
(3154, 'Poti incerca un consult medical general la clinicaxxxxx si poti folosi voucher-ul voucherxxxxx', '2019-07-04 07:56:25.530638', '2019-07-04 07:56:25.530638', 157, 2, 50, 3153, 0),
(3153, 'Da, ok.', '2019-07-04 07:56:25.520878', '2019-07-04 07:56:25.520878', 157, 2, 61, 3152, 1),
(3152, 'Voucherul este pentru reduceri.', '2019-07-04 07:56:25.511118', '2019-07-04 07:56:25.511118', 157, 2, 19, 3151, 0),
(3151, 'Voucher? Pentru ce?', '2019-07-04 07:56:25.493550', '2019-07-04 07:56:25.493550', 157, 2, 71, 3150, 1),
(3150, 'Iti pot oferi si voucher pentru clinicaxxxxx, daca te intereseaza.', '2019-07-04 07:56:25.483791', '2019-07-04 07:56:25.483791', 157, 2, 21, 3149, 0),
(3149, 'Nu, multumesc.', '2019-07-04 07:56:25.473054', '2019-07-04 07:56:25.473054', 157, 2, 26, 3148, 1),
(3148, 'Vrei sa iti recomand o clinica pentru un consult medical?', '2019-07-04 07:56:25.462319', '2019-07-04 07:56:25.462319', 157, 2, 63, 3147, 0),
(3147, 'Ok, multumesc mult. Sper sa fie ok.', '2019-07-04 07:56:25.451582', '2019-07-04 07:56:25.451582', 157, 2, 2, 3146, 1),
(3146, 'Durerile de cap pot aparea deseori, insa e important sa te odihnesti si sa faci sport macar 30 de minute in fiecare zi.', '2019-07-04 07:56:25.440846', '2019-07-04 07:56:25.440846', 157, 2, 73, 3145, 0),
(3145, 'Da, destul de stresat. Avem proiecte grele si termene limita foarte restranse.', '2019-07-04 07:56:25.431087', '2019-07-04 07:56:25.431087', 157, 2, 2, 3144, 1),
(3144, 'Te simti stresat la locul de munca?', '2019-07-04 07:56:25.421326', '2019-07-04 07:56:25.421326', 157, 2, 43, 3143, 0),
(3143, 'Da, dar nu excesiv.', '2019-07-04 07:56:25.410590', '2019-07-04 07:56:25.410590', 157, 2, 2, 3142, 1),
(3142, 'Bei multa cafea?', '2019-07-04 07:56:25.400831', '2019-07-04 07:56:25.400831', 157, 2, 20, 3141, 0),
(3141, 'Beau normal. Apa, doi litri pe zi.', '2019-07-04 07:56:25.390094', '2019-07-04 07:56:25.390094', 157, 2, 2, 3140, 1),
(3140, 'Bei multe lichide?', '2019-07-04 07:56:25.380334', '2019-07-04 07:56:25.380334', 157, 2, 43, 3139, 0),
(3139, 'Am 25 de ani, lucrez 8 ore pe zi, dorm ok, mananc ok.', '2019-07-04 07:56:25.370574', '2019-07-04 07:56:25.370574', 157, 2, 2, 3138, 1),
(3138, 'Poti sa imi oferi mai multe detalii?', '2019-07-04 07:56:25.358863', '2019-07-04 07:56:25.358863', 157, 2, 91, 3137, 0),
(3137, 'Nu am luat pastile. Am incercat sa dorm.', '2019-07-04 07:56:25.349102', '2019-07-04 07:56:25.349102', 157, 2, 2, 3136, 1),
(3136, 'Poti sa imi spui, te rog, daca esti sub tratament?', '2019-07-04 07:56:25.336414', '2019-07-04 07:56:25.336414', 157, 2, 43, 3135, 0),
(3135, 'Am luat de toate.', '2019-07-04 07:56:25.326654', '2019-07-04 07:56:25.326654', 157, 2, 2, 3134, 1),
(3134, 'Inteleg. Iei medicamente pentru aceasta problema, <NAME>?', '2019-07-04 07:56:25.313966', '2019-07-04 07:56:25.313966', 157, 2, 43, 3133, 0),
(3133, 'Ma doare capul foarte tare!', '2019-07-04 07:56:25.303230', '2019-07-04 07:56:25.303230', 157, 2, 52, 3132, 1),
(3132, 'Poti sa imi explici mai clar care este problema, te rog?', '2019-07-04 07:56:25.290542', '2019-07-04 07:56:25.290542', 157, 2, 91, 3131, 0),
(3131, 'Am o migrena infioratoare si nu mai stiu ce sa fac sa scap de ea.', '2019-07-04 07:56:25.260286', '2019-07-04 07:56:25.260286', 157, 2, 2, 3130, 1),
(3130, 'Buna. Sunt <NAMEBOT>. Cu ce iti pot fi de folos azi?', '2019-07-04 07:56:25.216838', '2019-07-04 07:56:25.216838', 157, 2, 1, NULL, 0),
(3129, 'Iti urez o zi usoara, <NAME>.', '2019-07-04 07:56:25.126505', '2019-07-04 07:56:25.126505', 156, 2, 28, 3128, 0),
(3128, 'La revedere <NAMEBOT>.', '2019-07-04 07:56:25.091335', '2019-07-04 07:56:25.091335', 156, 2, 28, 3127, 1),
(3127, 'In regula.', '2019-07-04 07:56:25.073766', '2019-07-04 07:56:25.073766', 156, 2, 2, 3126, 0),
(3126, 'Nu. O sa ma descurc.', '2019-07-04 07:56:25.045898', '2019-07-04 07:56:25.045898', 156, 2, 26, 3125, 1),
(3125, 'Cum doresti. Te mai pot ajuta cu ceva?', '2019-07-04 07:56:25.034657', '2019-07-04 07:56:25.034657', 156, 2, 72, 3124, 0),
(3124, 'Nu vreau sa fac asta!', '2019-07-04 07:56:25.021920', '2019-07-04 07:56:25.021920', 156, 2, 2, 3123, 1),
(3123, 'Nu pot oferi diagnostic concret, insa recomand sa suni la 112 in cazul unei urgente medicale.', '2019-07-04 07:56:25.009716', '2019-07-04 07:56:25.009716', 156, 2, 44, 3122, 0),
(3122, 'Crezi ca e un atac de cord?', '2019-07-04 07:56:24.999436', '2019-07-04 07:56:24.999436', 156, 2, 66, 3121, 1),
(3121, 'Inteleg, dar in acest caz, numai un medic specialist te poate ajuta.', '2019-07-04 07:56:24.989678', '2019-07-04 07:56:24.989678', 156, 2, 2, 3120, 0),
(3120, 'Nu ma ajuta.', '2019-07-04 07:56:24.979917', '2019-07-04 07:56:24.979917', 156, 2, 2, 3119, 1),
(3119, 'Imi pare rau, pot doar sa recomand clinici medicale.', '2019-07-04 07:56:24.970156', '2019-07-04 07:56:24.970156', 156, 2, 2, 3118, 0),
(3118, 'Nu-mi poti recomanda un medicament?', '2019-07-04 07:56:24.959420', '2019-07-04 07:56:24.959420', 156, 2, 2, 3117, 1),
(3117, 'Ramai calm si solicita ajutor de la un medic specializat.', '2019-07-04 07:56:24.949660', '2019-07-04 07:56:24.949660', 156, 2, 84, 3116, 0),
(3116, 'Si ce fac cu inima pana atunci?', '2019-07-04 07:56:24.936972', '2019-07-04 07:56:24.936972', 156, 2, 32, 3115, 1),
(3115, 'Ok, iti recomand o vizita medicala la clinicaxxxxx, sau solicita ambulanta la 112.', '2019-07-04 07:56:24.927212', '2019-07-04 07:56:24.927212', 156, 2, 84, 3114, 0),
(3114, 'Nu stiu! Ma strange inima si sunt agitat.', '2019-07-04 07:56:24.916477', '2019-07-04 07:56:24.916477', 156, 2, 67, 3113, 1),
(3113, 'Poti sa imi explici care este problema mai clar, te rog?', '2019-07-04 07:56:24.902812', '2019-07-04 07:56:24.902812', 156, 2, 91, 3112, 0),
(3112, 'Simt furnicaturi pe bratul stang.', '2019-07-04 07:56:24.893052', '2019-07-04 07:56:24.893052', 156, 2, 2, 3111, 1),
(3111, 'Alte simptome ai?', '2019-07-04 07:56:24.883292', '2019-07-04 07:56:24.883292', 156, 2, 43, 3110, 0),
(3109, 'De cat timp ai aceasta problema?', '2019-07-04 07:56:24.863772', '2019-07-04 07:56:24.863772', 156, 2, 43, 3108, 0),
(3110, 'De doua ore.', '2019-07-04 07:56:24.873532', '2019-07-04 07:56:24.873532', 156, 2, 2, 3109, 1),
(3108, 'Nu. Am baut ceai cald dar atat.', '2019-07-04 07:56:24.854012', '2019-07-04 07:56:24.854012', 156, 2, 2, 3107, 1),
(3107, 'Inteleg. Iei tratament pentru asta?', '2019-07-04 07:56:24.844252', '2019-07-04 07:56:24.844252', 156, 2, 43, 3106, 0),
(3106, 'Nu stiu cum sa explic. Simt asa ca o gheara in piept.', '2019-07-04 07:56:24.833517', '2019-07-04 07:56:24.834493', 156, 2, 67, 3105, 1),
(3105, 'Desigur, cu ce te pot ajuta, <NAME>?', '2019-07-04 07:56:24.824732', '2019-07-04 07:56:24.824732', 156, 2, 91, 3104, 0),
(3104, 'Buna <NAMEBOT>. Am nevoie de ajutor!', '2019-07-04 07:56:24.813997', '2019-07-04 07:56:24.813997', 156, 2, 1, 3103, 1),
(3103, 'Buna. Sunt <NAMEBOT>. Cu ce te pot ajuta?', '2019-07-04 07:56:24.804236', '2019-07-04 07:56:24.804236', 156, 2, 1, NULL, 0),
(3102, 'La revedere!', '2019-07-04 07:56:24.786668', '2019-07-04 07:56:24.786668', 155, 2, 28, 3101, 0),
(3101, 'Cu nimic. pa!', '2019-07-04 07:56:24.775932', '2019-07-04 07:56:24.775932', 155, 2, 28, 3100, 1),
(3100, 'Sa imi spui daca as putea ajuta cu altceva.', '2019-07-04 07:56:24.767148', '2019-07-04 07:56:24.767148', 155, 2, 72, 3099, 0),
(3099, 'Nu m-ai ajutat deloc!', '2019-07-04 07:56:24.757388', '2019-07-04 07:56:24.757388', 155, 2, 2, 3098, 1),
(3098, 'Cred ca cel mai bine te poate indruma un medic.', '2019-07-04 07:56:24.747628', '2019-07-04 07:56:24.747628', 155, 2, 2, 3097, 0),
(3097, 'Dar medicamente ce pot sa iau?', '2019-07-04 07:56:24.737869', '2019-07-04 07:56:24.737869', 155, 2, 2, 3096, 1),
(3095, 'Zi-mi tu ce sa iau!', '2019-07-04 07:56:24.718348', '2019-07-04 07:56:24.718348', 155, 2, 37, 3094, 1),
(3096, 'Iti recomand o alimentatie echilibrata, un regim de viata sanatos si sa te hidratezi.', '2019-07-04 07:56:24.728108', '2019-07-04 07:56:24.728108', 155, 2, 55, 3095, 0),
(3094, 'Sunt sigura ca cei de la clinica te vor indruma mai departe.', '2019-07-04 07:56:24.708588', '2019-07-04 07:56:24.708588', 155, 2, 2, 3093, 0),
(3093, 'Sa ma dau cu unguent? Sa iau ceva?', '2019-07-04 07:56:24.698829', '2019-07-04 07:56:24.698829', 155, 2, 2, 3092, 1),
(3092, 'Te asigur ca indiferent ce este, te pot ajuta. Iti recomand urgent un consult medical la un dermatolog.', '2019-07-04 07:56:24.689069', '2019-07-04 07:56:24.689069', 155, 2, 47, 3091, 0),
(3091, 'Nu. Mi-e frica! Daca e ceva grav?', '2019-07-04 07:56:24.679309', '2019-07-04 07:56:24.679309', 155, 2, 2, 3090, 1),
(3090, 'Ai alte simptome?', '2019-07-04 07:56:24.669548', '2019-07-04 07:56:24.669548', 155, 2, 43, 3089, 0),
(3089, 'Doar la lactate. Am intoleranta la lactate, dar nu alergie. Deci nu cred ca am alergii mari.', '2019-07-04 07:56:24.659788', '2019-07-04 07:56:24.659788', 155, 2, 64, 3088, 1),
(3088, 'Ai alergie la ceva anume?', '2019-07-04 07:56:24.651005', '2019-07-04 07:56:24.651005', 155, 2, 59, 3087, 0),
(3086, 'De cat timp ai aceasta problema?', '2019-07-04 07:56:24.631485', '2019-07-04 07:56:24.631485', 155, 2, 43, 3085, 0),
(3087, 'Azi dimineata le-am observat.', '2019-07-04 07:56:24.641244', '2019-07-04 07:56:24.641244', 155, 2, 2, 3086, 1),
(3085, 'Sunt puncte rosii, mi-au aparut pe piept si nu stiu de la ce.', '2019-07-04 07:56:24.621724', '2019-07-04 07:56:24.621724', 155, 2, 64, 3084, 1),
(3084, 'Imi pare rau, <NAME>. Imi poti da mai multe detalii, te rog?', '2019-07-04 07:56:24.611965', '2019-07-04 07:56:24.611965', 155, 2, 91, 3083, 0),
(3083, 'Mi-au aparut niste puncte rosii', '2019-07-04 07:56:24.603181', '2019-07-04 07:56:24.603181', 155, 2, 64, 3082, 1),
(3082, 'Buna. Sunt <NAMEBOT>. Cu ce te pot ajuta?', '2019-07-04 07:56:24.592444', '2019-07-04 07:56:24.593420', 155, 2, 1, NULL, 0),
(3081, 'O zi placuta!', '2019-07-04 07:56:24.574876', '2019-07-04 07:56:24.574876', 154, 2, 28, 3080, 0),
(3080, 'Super! Multu! :)', '2019-07-04 07:56:24.564142', '2019-07-04 07:56:24.565117', 154, 2, 28, 3079, 1),
(3078, 'Si cu asta ma duc la clinica?', '2019-07-04 07:56:24.545597', '2019-07-04 07:56:24.545597', 154, 2, 2, 3077, 1),
(3079, 'Orice detaliu se stabileste telefonic cu clinica.', '2019-07-04 07:56:24.554381', '2019-07-04 07:56:24.554381', 154, 2, 2, 3078, 0),
(3077, 'Un voucher iti da reducere la serviciul medical primit. Poti merge la clinicaxxxxx cu acest cod (voucherxxxxx)', '2019-07-04 07:56:24.534860', '2019-07-04 07:56:24.534860', 154, 2, 50, 3076, 0),
(3076, 'Voucher pentru ce?', '2019-07-04 07:56:24.526076', '2019-07-04 07:56:24.526076', 154, 2, 71, 3075, 1),
(3075, 'Daca vrei, iti pot oferi un voucher.', '2019-07-04 07:56:24.516317', '2019-07-04 07:56:24.516317', 154, 2, 21, 3074, 0),
(3074, 'Iar dau bani aiurea.', '2019-07-04 07:56:24.505581', '2019-07-04 07:56:24.505581', 154, 2, 87, 3073, 1),
(3073, 'Intotdeauna e bine sa cautam opinii medicale pana gasim solutii.', '2019-07-04 07:56:24.495821', '2019-07-04 07:56:24.495821', 154, 2, 73, 3072, 0),
(3072, 'Pai si ceilalti doctori au incercat sa ma ajute si n-au rezolvat nimic.', '2019-07-04 07:56:24.486060', '2019-07-04 07:56:24.486060', 154, 2, 2, 3071, 1),
(3071, 'Sunt perfect convinsa ca doctorul iti va putea da un tratament adecvat.', '2019-07-04 07:56:24.475325', '2019-07-04 07:56:24.475325', 154, 2, 77, 3070, 0),
(3070, 'Si crezi la clinicaxxxxx o sa stie doctorul ce sa imi dea?', '2019-07-04 07:56:24.465565', '2019-07-04 07:56:24.465565', 154, 2, 90, 3069, 1),
(3069, 'In acest caz iti sugerez sa incerci la clinicaxxxxx si sa iti faci o programare la un medic specialist.', '2019-07-04 07:56:24.454829', '2019-07-04 07:56:24.454829', 154, 2, 11, 3068, 0);
INSERT INTO `conversation_editor_chatline` (`id`, `message`, `created`, `updated`, `chat_id`, `created_user_id`, `label_id`, `parent_id`, `human`) VALUES
(3068, 'Nu, am fost la doctorul de familie si alti doi.', '2019-07-04 07:56:24.444093', '2019-07-04 07:56:24.444093', 154, 2, 2, 3067, 1),
(3067, 'Ai incercat sa mergi la clinicaxxxxx?', '2019-07-04 07:56:24.434333', '2019-07-04 07:56:24.434333', 154, 2, 63, 3066, 0),
(3066, 'De doua saptamani aproape. Nu mai stiu ce sa fac.', '2019-07-04 07:56:24.418717', '2019-07-04 07:56:24.418717', 154, 2, 2, 3065, 1),
(3065, 'De cat timp te doare?', '2019-07-04 07:56:24.407005', '2019-07-04 07:56:24.407005', 154, 2, 43, 3064, 0),
(3064, 'Da. Am incercat mai multe medicamente dar nu au facut nimic.', '2019-07-04 07:56:24.395293', '2019-07-04 07:56:24.395293', 154, 2, 2, 3063, 1),
(3063, 'Ai facut un tratament?', '2019-07-04 07:56:24.377220', '2019-07-04 07:56:24.377220', 154, 2, 43, 3062, 0),
(3062, 'Am o problema! Ma doare <UNK>. Nu stiu unde sa ma mai duc. Am fost la 3 doctori si tot ma doare.', '2019-07-04 07:56:24.363556', '2019-07-04 07:56:24.363556', 154, 2, 37, 3061, 1),
(3060, 'Sarut mana!', '2019-07-04 07:56:24.342084', '2019-07-04 07:56:24.342084', 154, 2, 1, 3059, 1),
(3061, 'Buna, <NAME>. Cu ce te pot ajuta?', '2019-07-04 07:56:24.352820', '2019-07-04 07:56:24.352820', 154, 2, 91, 3060, 0),
(3058, 'Cu placere!', '2019-07-04 07:56:24.313780', '2019-07-04 07:56:24.313780', 153, 2, 28, 3057, 0),
(3059, 'Buna ziua! Sunt <NAMEBOT>. Cu ce te pot ajuta astazi?', '2019-07-04 07:56:24.331348', '2019-07-04 07:56:24.331348', 154, 2, 1, NULL, 0),
(3057, 'Mersi!', '2019-07-04 07:56:24.304020', '2019-07-04 07:56:24.304020', 153, 2, 2, 3056, 1),
(3056, 'Orice detaliu se stabileste telefonic cu centrul medical. Iti pot recomanda clinicaxxxxx.', '2019-07-04 07:56:24.293284', '2019-07-04 07:56:24.293284', 153, 2, 11, 3055, 0),
(3055, 'Cum se numeste medicul?', '2019-07-04 07:56:24.283525', '2019-07-04 07:56:24.284501', 153, 2, 41, 3054, 1),
(3054, 'Nu pot recomanda medicamente. Poti intreba medicul.', '2019-07-04 07:56:24.266932', '2019-07-04 07:56:24.266932', 153, 2, 73, 3053, 0),
(3053, 'Pot lua niste picaturi de ureche? Sau sa picur un tip de ceai anti inflamator?', '2019-07-04 07:56:24.257172', '2019-07-04 07:56:24.257172', 153, 2, 69, 3052, 1),
(3052, 'Te poate ajuta medicul specialist.', '2019-07-04 07:56:24.247412', '2019-07-04 07:56:24.247412', 153, 2, 2, 3051, 0),
(3051, 'Dar ce pot sa fac ca sa aud normal?', '2019-07-04 07:56:24.237652', '2019-07-04 07:56:24.237652', 153, 2, 69, 3050, 1),
(3050, 'Atunci, iti recomand o vizita la clinicaxxxxx sa te vada un medic ORL-ist.', '2019-07-04 07:56:24.227892', '2019-07-04 07:56:24.227892', 153, 2, 79, 3049, 0),
(3049, 'Nu din cate imi amintesc. Si nu cred ca am stat in curent acum, ca nu ma doare.', '2019-07-04 07:56:24.216180', '2019-07-04 07:56:24.217157', 153, 2, 69, 3048, 1),
