(2797, 'Da. Des. Parca din ce in ce mai des.', '2019-07-04 07:56:21.311032', '2019-07-04 07:56:21.311032', 142, 2, 37, 2796, 1),
(2796, 'Ai probleme cu odihna?', '2019-07-04 07:56:21.301272', '2019-07-04 07:56:21.301272', 142, 2, 42, 2795, 0),
