(2791, 'Sunt stresat si obosit constant. Nu mai suport starea asta.', '2019-07-04 07:56:21.253920', '2019-07-04 07:56:21.253920', 142, 2, 37, 2790, 1),
(2790, 'Bine ai venit. Despre ce problema vrei sa vorbim?', '2019-07-04 07:56:21.241231', '2019-07-04 07:56:21.241231', 142, 2, 91, 2789, 0),
(2789, 'Uite am acum o pauza si am venit sa vorbesc cu tine.', '2019-07-04 07:56:21.229520', '2019-07-04 07:56:21.229520', 142, 2, 2, 2788, 1),
(2788, 'Bine, <NAME>. Cum te pot ajuta?', '2019-07-04 07:56:21.217807', '2019-07-04 07:56:21.217807', 142, 2, 91, 2787, 0),
(2787, 'Sarut mana <NAMEBOT>! Ce mai faci?', '2019-07-04 07:56:21.206096', '2019-07-04 07:56:21.206096', 142, 2, 1, 2786, 1),
(2786, 'Buna! Numele meu este <NAMEBOT>. Cu ce te pot ajuta?', '2019-07-04 07:56:21.194383', '2019-07-04 07:56:21.195360', 142, 2, 1, NULL, 0),
(2785, 'Pe curand, <NAME>!', '2019-07-04 07:56:21.174357', '2019-07-04 07:56:21.174357', 141, 2, 28, 2784, 0),
