(2768, 'Da. Am mancat ieri seara niste paste cu sos rosu si de atunci ma tot doare tot mai tare. Cred ca m-am stricat la stomac.', '2019-07-04 07:56:20.973302', '2019-07-04 07:56:20.973302', 141, 2, 53, 2767, 1),
