(2734, 'Ok, da-mi te rog un voucher.', '2019-07-04 07:56:20.638470', '2019-07-04 07:56:20.638470', 139, 2, 61, 2733, 1),
(2733, 'Pe langa recomandare, iti pot oferi si un voucher cu reducere. Te intereseaza?', '2019-07-04 07:56:20.629685', '2019-07-04 07:56:20.629685', 139, 2, 21, 2732, 0),
(2732, 'Pai da dar la clinica nu e scump?', '2019-07-04 07:56:20.620901', '2019-07-04 07:56:20.620901', 139, 2, 87, 2731, 1),
(2731, 'Daca vrei, iti pot recomanda clinicaxxxxx.', '2019-07-04 07:56:20.611142', '2019-07-04 07:56:20.611142', 139, 2, 11, 2730, 0),
(2730, 'Si unde gasesc un medic care sa ma ajute?', '2019-07-04 07:56:20.601381', '2019-07-04 07:56:20.601381', 139, 2, 41, 2729, 1),
(2729, 'Din nefericire, nu pot oferi acest gen de informatii, insa un medic specializat iti poate fi de folos.', '2019-07-04 07:56:20.592597', '2019-07-04 07:56:20.592597', 139, 2, 73, 2728, 0),
