(2435, 'Am inteles. De cat timp ai problema asta?', '2019-07-04 07:56:17.382401', '2019-07-04 07:56:17.382401', 126, 2, 43, 2434, 0),
(2436, 'De ieri seara.', '2019-07-04 07:56:17.391184', '2019-07-04 07:56:17.391184', 126, 2, 2, 2435, 1),
(2434, 'Ma simt slabit si nu pot sa mananc. Imi este greata daca incerc.', '2019-07-04 07:56:17.371665', '2019-07-04 07:56:17.371665', 126, 2, 53, 2433, 1),
(2433, 'Poti sa imi explici mai clar care este problema, te rog?', '2019-07-04 07:56:17.356519', '2019-07-04 07:56:17.356519', 126, 2, 91, 2432, 0),
(2432, 'Ce sa fac daca nu am pofta de mancare?', '2019-07-04 07:56:17.341879', '2019-07-04 07:56:17.341879', 126, 2, 53, 2431, 1),
(2431, 'Te ascult.', '2019-07-04 07:56:17.332119', '2019-07-04 07:56:17.332119', 126, 2, 91, 2430, 0),
(2429, 'Am cu ce sa te ajut?', '2019-07-04 07:56:17.301863', '2019-07-04 07:56:17.301863', 126, 2, 91, 2428, 0),
(2430, 'Da, am o intrebare.', '2019-07-04 07:56:17.317479', '2019-07-04 07:56:17.317479', 126, 2, 2, 2429, 1),
(2428, 'Bine!', '2019-07-04 07:56:17.287223', '2019-07-04 07:56:17.287223', 126, 2, 2, 2427, 1),
(2426, 'Buna <NAMEBOT>', '2019-07-04 07:56:17.255991', '2019-07-04 07:56:17.255991', 126, 2, 1, 2425, 1),
(2427, 'Cum te simti azi, <NAME>?', '2019-07-04 07:56:17.270631', '2019-07-04 07:56:17.270631', 126, 2, 91, 2426, 0),
(2425, 'Buna, ma numesc <NAMEBOT>! Te pot ajuta cu ceva?', '2019-07-04 07:56:17.241351', '2019-07-04 07:56:17.241351', 126, 2, 1, NULL, 0),
(4184, 'Poti sa imi oferi mai multe informatii, te rog?', '2019-07-04 07:56:37.578155', '2019-07-04 07:56:37.578155', 202, 2, 91, 4183, 0),
(4185, 'Am dureri de cap si nu pot sa adorm orice as face.', '2019-07-04 07:56:37.586939', '2019-07-04 07:56:37.586939', 202, 2, 37, 4184, 1),
(4186, 'Starile de rau apar constant sau intermitent?', '2019-07-04 07:56:37.596699', '2019-07-04 07:56:37.596699', 202, 2, 43, 4185, 0),
(4187, 'Intermitenta.', '2019-07-04 07:56:37.606459', '2019-07-04 07:56:37.606459', 202, 2, 2, 4186, 1),
(4188, 'Ai si alte simptome?', '2019-07-04 07:56:37.615243', '2019-07-04 07:56:37.615243', 202, 2, 43, 4187, 0),
(4189, 'In afara de durerile de cap mai am si ameteli.', '2019-07-04 07:56:37.625002', '2019-07-04 07:56:37.625002', 202, 2, 37, 4188, 1),
(4190, 'Ai parte de stress in timpul zilei?', '2019-07-04 07:56:37.634763', '2019-07-04 07:56:37.634763', 202, 2, 42, 4189, 0),
(4191, 'Da, dar nu mai mult ca de obicei. Lucrez pe un santier de constructii.', '2019-07-04 07:56:37.644523', '2019-07-04 07:56:37.644523', 202, 2, 2, 4190, 1),
(4192, 'De cat timp ai aceasta problema?', '2019-07-04 07:56:37.654283', '2019-07-04 07:56:37.654283', 202, 2, 43, 4191, 0),
(4193, 'De cateva zile. La inceput nu ma durea atat de tare dar acum ma deranjeaza.', '2019-07-04 07:56:37.663067', '2019-07-04 07:56:37.663067', 202, 2, 2, 4192, 1),
(4194, 'Ai fost la un medic pana acum?', '2019-07-04 07:56:37.672827', '2019-07-04 07:56:37.672827', 202, 2, 43, 4193, 0),
(4195, 'Nu. Poti sa imi recomanzi ceva pentru durere?', '2019-07-04 07:56:37.682587', '2019-07-04 07:56:37.682587', 202, 2, 37, 4194, 1),
(4196, 'Ce as recomanda ar fi sa vorbesti cu un medic specializat pentru un tratament adecvat.', '2019-07-04 07:56:37.692347', '2019-07-04 07:56:37.692347', 202, 2, 55, 4195, 0),
(4197, 'Unde imi sugerezi sa ma duc pentru un consult bun?', '2019-07-04 07:56:37.701131', '2019-07-04 07:56:37.701131', 202, 2, 41, 4196, 1),
(4198, 'Iti recomand centrul medical clinicaxxxxx.', '2019-07-04 07:56:37.715771', '2019-07-04 07:56:37.715771', 202, 2, 11, 4197, 0),
(4199, 'Doar atat?', '2019-07-04 07:56:37.725531', '2019-07-04 07:56:37.725531', 202, 2, 18, 4198, 1),
(4200, 'Daca vrei, poti vedea pe site-ul nostru articole care abordeaza teme similare: sitexxxxx', '2019-07-04 07:56:37.734315', '2019-07-04 07:56:37.734315', 202, 2, 12, 4199, 0),
(4201, 'Dar ce medicamente pot sa iau?', '2019-07-04 07:56:37.743099', '2019-07-04 07:56:37.743099', 202, 2, 52, 4200, 1),
(4202, 'Numai un medic specializat iti poate da o solutie in acest sens pe baza unui consult.', '2019-07-04 07:56:37.752859', '2019-07-04 07:56:37.752859', 202, 2, 73, 4201, 0),
(4203, 'Si la care medic sa ma duc?', '2019-07-04 07:56:37.761643', '2019-07-04 07:56:37.761643', 202, 2, 41, 4202, 1),
(4204, 'Informatii legate la specialisti, sau pentru programari, le poti afla fie telefonic sau in persoana la clinic.', '2019-07-04 07:56:37.774331', '2019-07-04 07:56:37.774331', 202, 2, 11, 4203, 0),
(4205, 'Bine, iti multumesc mult!', '2019-07-04 07:56:37.784091', '2019-07-04 07:56:37.784091', 202, 2, 2, 4204, 1),
(4206, 'Cu drag, <NAME>. O zi usoara!', '2019-07-04 07:56:37.792874', '2019-07-04 07:56:37.792906', 202, 2, 28, 4205, 0),
(4207, 'Buna! Ma numesc <NAMEBOT>. Cu ce te pot ajuta?', '2019-07-04 07:56:37.808491', '2019-07-04 07:56:37.808491', 203, 2, 1, NULL, 0),
(4208, 'Am o problema de sanatate.', '2019-07-04 07:56:37.817779', '2019-07-04 07:56:37.817779', 203, 2, 2, 4207, 1),
(4209, 'Te ascult, <NAME>. Ce problema ai?', '2019-07-04 07:56:37.826563', '2019-07-04 07:56:37.826563', 203, 2, 91, 4208, 0),
(4210, 'Ma doare rau un picior, la glezna. Cred ca mi-am sucit glezna.', '2019-07-04 07:56:37.835348', '2019-07-04 07:56:37.835348', 203, 2, 46, 4209, 1),
(4211, 'Cum s-a intamplat?', '2019-07-04 07:56:37.844131', '2019-07-04 07:56:37.845107', 203, 2, 48, 4210, 0),
(4212, 'Mergeam pe afara si am calcat stramb. Nu am mai putut merge deloc.', '2019-07-04 07:56:37.853891', '2019-07-04 07:56:37.853891', 203, 2, 46, 4211, 1),
(4213, 'De cat timp te doare?', '2019-07-04 07:56:37.862676', '2019-07-04 07:56:37.862676', 203, 2, 43, 4212, 0),
(4214, 'De cateva minute. Tocmai ce m-am intors de afara.', '2019-07-04 07:56:37.871459', '2019-07-04 07:56:37.871459', 203, 2, 2, 4213, 1),
(4215, 'Zona afectata este vanata?', '2019-07-04 07:56:37.880243', '2019-07-04 07:56:37.880243', 203, 2, 48, 4214, 0),
(4216, 'Da.', '2019-07-04 07:56:37.889027', '2019-07-04 07:56:37.889027', 203, 2, 61, 4215, 1),
(4217, 'Ai cerut opinia unui medic pana acum?', '2019-07-04 07:56:37.898787', '2019-07-04 07:56:37.898787', 203, 2, 43, 4216, 0),
(4218, 'Nu inca. Voiam sa vad daca pot sa gasesc un tratament pe internet.', '2019-07-04 07:56:37.907571', '2019-07-04 07:56:37.907571', 203, 2, 2, 4217, 1),
(4219, 'Ar avea cum o compresa rece sa te ajuta?', '2019-07-04 07:56:37.917331', '2019-07-04 07:56:37.917331', 203, 2, 48, 4218, 0),
(4220, 'Da, stau cu ea pe glezna dar imi e teama sa nu se fi rupt ceva la picior.', '2019-07-04 07:56:37.927091', '2019-07-04 07:56:37.927091', 203, 2, 46, 4219, 1),
(4221, 'In acest caz este indicat sa te adresezi unui medic. Incearca la clinicaxxxxx si programeaza-ti un consult.', '2019-07-04 07:56:37.935875', '2019-07-04 07:56:37.935875', 203, 2, 11, 4220, 0),
(4222, 'De ce la clinicaxxxxx? Nu pot sa ma duc la spitalul de langa mine?', '2019-07-04 07:56:37.945635', '2019-07-04 07:56:37.945635', 203, 2, 90, 4221, 1),
(4223, 'Este o clinica specializata unde poti primi ajutorul de care ai nevoie. Daca vrei, pot sa iti dau acest voucher (voucherxxxxx) pentru a beneficia de o reducere.', '2019-07-04 07:56:37.955395', '2019-07-04 07:56:37.955395', 203, 2, 77, 4222, 0),
(4224, 'Eu nu cred ca pot sa merg. Ma doare foarte tare piciorul. Cred ca este luxat grav.', '2019-07-04 07:56:37.965155', '2019-07-04 07:56:37.965155', 203, 2, 66, 4223, 1),
(4225, 'Daca este o situatie grava, suna la 112.', '2019-07-04 07:56:37.975892', '2019-07-04 07:56:37.975892', 203, 2, 44, 4224, 0),
(4226, 'Bine, multumesc.', '2019-07-04 07:56:37.985651', '2019-07-04 07:56:37.985651', 203, 2, 2, 4225, 1),
(4227, 'Pentru putin. La revedere!', '2019-07-04 07:56:37.997364', '2019-07-04 07:56:37.997364', 203, 2, 28, 4226, 0),
(4228, 'La revedere.', '2019-07-04 07:56:38.017859', '2019-07-04 07:56:38.017859', 203, 2, 28, 4227, 1),
(4229, 'Buna ziua, <NAME>! Sunt <NAMEBOT>. Cum iti pot fi de folos?', '2019-07-04 07:56:38.040308', '2019-07-04 07:56:38.040308', 204, 2, 1, NULL, 0),
(4230, 'Buna. Nu stiu de ce dar nu mai am vlaga. Am o stare neplacuta si imi este greu sa fac ceva.', '2019-07-04 07:56:38.053973', '2019-07-04 07:56:38.053973', 204, 2, 37, 4229, 1),
(4231, 'Inteleg. Ai si alte simptome?', '2019-07-04 07:56:38.071539', '2019-07-04 07:56:38.071539', 204, 2, 43, 4230, 0),
(4232, 'Nu. Pur si simplu nu sunt in stare sa fac nimic. Sunt fara energie.', '2019-07-04 07:56:38.084228', '2019-07-04 07:56:38.084228', 204, 2, 37, 4231, 1),
(4233, 'Ai o alimentatie echilibrata?', '2019-07-04 07:56:38.096915', '2019-07-04 07:56:38.096915', 204, 2, 43, 4232, 0),
(4234, 'Incerc sa am dar nu prea am timp sa mananc in timpul zilei.', '2019-07-04 07:56:38.109603', '2019-07-04 07:56:38.109603', 204, 2, 2, 4233, 1),
(4235, 'Ai un program de odihna sanatos?', '2019-07-04 07:56:38.122293', '2019-07-04 07:56:38.122293', 204, 2, 42, 4234, 0),
(4236, 'Nu prea. Lucez mult si nu am ore fixe de odihna.', '2019-07-04 07:56:38.132051', '2019-07-04 07:56:38.132051', 204, 2, 2, 4235, 1),
(4237, 'Faci sport sau activitate fizica in fiecare zi?', '2019-07-04 07:56:38.143763', '2019-07-04 07:56:38.143763', 204, 2, 42, 4236, 0),
(4238, 'Nu. Nici macar sa ma plimb nu mai vreau.', '2019-07-04 07:56:38.153523', '2019-07-04 07:56:38.153523', 204, 2, 2, 4237, 1),
(4239, 'Este necesar sa ai un program sanatos de viata si sa ai o alimentatie adecvata.', '2019-07-04 07:56:38.164259', '2019-07-04 07:56:38.164259', 204, 2, 55, 4238, 0),
(4240, 'Cum pot sa fac asta?', '2019-07-04 07:56:38.176948', '2019-07-04 07:56:38.176948', 204, 2, 2, 4239, 1),
(4241, 'Pentru un mod de viata mai sanatos, bea minim 2 litri de apa pe zi si consuma alimente care contin nutrienti si vitamine. Un regim alimentar este un pas esential.', '2019-07-04 07:56:38.191587', '2019-07-04 07:56:38.191587', 204, 2, 55, 4240, 0),
(4242, 'Bine, asa o sa fac. Poti sa imi spui cum sa imi imbunatatesc starea de bine?', '2019-07-04 07:56:38.204275', '2019-07-04 07:56:38.204275', 204, 2, 39, 4241, 1),
(4243, 'Avem numeroase articole pe site care te pot ajuta: sitexxxxx', '2019-07-04 07:56:38.215011', '2019-07-04 07:56:38.215011', 204, 2, 12, 4242, 0),
(4244, 'Multumesc mult! O sa ma uit in curand', '2019-07-04 07:56:38.229651', '2019-07-04 07:56:38.229651', 204, 2, 2, 4243, 1),
(4245, 'Iti recomand si un consult la un medic generalist pentru un diagnostic adecvat.', '2019-07-04 07:56:38.239411', '2019-07-04 07:56:38.239411', 204, 2, 73, 4244, 0),
(4246, 'Unde ma pot duce pentru analize?', '2019-07-04 07:56:38.248195', '2019-07-04 07:56:38.248195', 204, 2, 41, 4245, 1),
(4247, 'Cel mai indicat este un consult la un medic din cadrul clinicii clinicaxxxxx.', '2019-07-04 07:56:38.257955', '2019-07-04 07:56:38.257955', 204, 2, 11, 4246, 0),
(4248, 'Au preturi accesibile? Nu pot sa spun ca stau stralucit cu banii.', '2019-07-04 07:56:38.266739', '2019-07-04 07:56:38.266739', 204, 2, 87, 4247, 1),
(4249, 'Poti merge cu acest voucher (voucherxxxxx) pentru a beneficia de o reducere.', '2019-07-04 07:56:38.276499', '2019-07-04 07:56:38.276499', 204, 2, 50, 4248, 0),
(4250, 'Perfect. Multumesc din suflet!', '2019-07-04 07:56:38.285282', '2019-07-04 07:56:38.285282', 204, 2, 2, 4249, 1),
(4251, 'Te mai pot ajuta cu altceva?', '2019-07-04 07:56:38.295043', '2019-07-04 07:56:38.295043', 204, 2, 72, 4250, 0),
(4252, 'Nu, mersi!', '2019-07-04 07:56:38.303827', '2019-07-04 07:56:38.303827', 204, 2, 26, 4251, 1),
(4253, 'Cu multa placere!', '2019-07-04 07:56:38.312611', '2019-07-04 07:56:38.312611', 204, 2, 28, 4252, 0),
(4254, 'Buna ziua! Eu sunt <NAMEBOT>. Cu ce te pot ajuta?', '2019-07-04 07:56:38.330179', '2019-07-04 07:56:38.330179', 205, 2, 1, NULL, 0),
(4255, 'Salut.', '2019-07-04 07:56:38.338963', '2019-07-04 07:56:38.338963', 205, 2, 1, 4254, 1),
(4256, 'Cum te pot ajuta azi, <NAME>?', '2019-07-04 07:56:38.347747', '2019-07-04 07:56:38.347747', 205, 2, 91, 4255, 0),
(4257, 'Am o intrebare.', '2019-07-04 07:56:38.356531', '2019-07-04 07:56:38.356531', 205, 2, 2, 4256, 1),
(4258, 'Te ascult. Cu ce informatii te pot ajuta?', '2019-07-04 07:56:38.365315', '2019-07-04 07:56:38.365315', 205, 2, 91, 4257, 0),
(4259, 'Obosesc repede la efort. Crezi ca e ceva grav?', '2019-07-04 07:56:38.374099', '2019-07-04 07:56:38.374099', 205, 2, 37, 4258, 1),
(4260, 'Poti sa imi prezinti problema in alt fel, te rog?', '2019-07-04 07:56:38.382883', '2019-07-04 07:56:38.382883', 205, 2, 91, 4259, 0),
(4261, 'Raman fara aer cand urc scarile.', '2019-07-04 07:56:38.392643', '2019-07-04 07:56:38.392643', 205, 2, 88, 4260, 1),
(4262, 'Poti sa imi descrii mai mult?', '2019-07-04 07:56:38.401427', '2019-07-04 07:56:38.401427', 205, 2, 91, 4261, 0),
(4263, 'Cand fac ceva, gen urc scarile de la bloc sau merg mai repede pe strada, imi bate inima tare si raman fara aer in piept.', '2019-07-04 07:56:38.410211', '2019-07-04 07:56:38.410211', 205, 2, 88, 4262, 1),
(4264, 'Ai mai avut antecedente de probleme pulmonare?', '2019-07-04 07:56:38.419971', '2019-07-04 07:56:38.419971', 205, 2, 62, 4263, 0),
(4265, 'Cred ca da. Mi se strange pieptul si ma dor plamanii.', '2019-07-04 07:56:38.428755', '2019-07-04 07:56:38.428755', 205, 2, 88, 4264, 1),
(4266, 'De cat timp ai aceasta problema?', '2019-07-04 07:56:38.438515', '2019-07-04 07:56:38.438515', 205, 2, 43, 4265, 0),
(4267, 'De cateva luni dar s-a agravat de cateva saptamani.', '2019-07-04 07:56:38.447299', '2019-07-04 07:56:38.447299', 205, 2, 2, 4266, 1),
(4268, 'Ai facut analize pana acum?', '2019-07-04 07:56:38.456083', '2019-07-04 07:56:38.456083', 205, 2, 43, 4267, 0),
(4269, 'Da, dar nu am avut nimic.', '2019-07-04 07:56:38.464867', '2019-07-04 07:56:38.464867', 205, 2, 2, 4268, 1),
(4270, 'Fumezi? Daca da, cat de des?', '2019-07-04 07:56:38.473651', '2019-07-04 07:56:38.473651', 205, 2, 62, 4269, 0),
(4271, 'Nu fumez si nu stau langa fumatori in general.', '2019-07-04 07:56:38.483411', '2019-07-04 07:56:38.483411', 205, 2, 2, 4270, 1);
INSERT INTO `conversation_editor_chatline` (`id`, `message`, `created`, `updated`, `chat_id`, `created_user_id`, `label_id`, `parent_id`, `human`) VALUES
(4272, 'As sugera sa mergi la un control pentru a face analize.', '2019-07-04 07:56:38.493171', '2019-07-04 07:56:38.493171', 205, 2, 55, 4271, 0),
(4273, 'Unde sa imi fac analizele?', '2019-07-04 07:56:38.501955', '2019-07-04 07:56:38.501955', 205, 2, 41, 4272, 1),
(4274, 'Iti pot face o recomandare pentru clinicaxxxxx.', '2019-07-04 07:56:38.510739', '2019-07-04 07:56:38.510739', 205, 2, 11, 4273, 0),
(4275, 'Si cat o sa ma coste asta?', '2019-07-04 07:56:38.520499', '2019-07-04 07:56:38.520499', 205, 2, 87, 4274, 1),
(4276, 'Daca vrei, poti folosi acest voucher (voucherxxxxx) pentru a beneficia de o reducere.', '2019-07-04 07:56:38.529283', '2019-07-04 07:56:38.529283', 205, 2, 50, 4275, 0),
(4277, 'Multumesc! Cand pot sa ma duc la clinica?', '2019-07-04 07:56:38.539043', '2019-07-04 07:56:38.539043', 205, 2, 2, 4276, 1),
(4278, 'Programarile se stabilesc telefonic.', '2019-07-04 07:56:38.548802', '2019-07-04 07:56:38.548802', 205, 2, 2, 4277, 0),
(4279, 'Bine. Multumesc!', '2019-07-04 07:56:38.557587', '2019-07-04 07:56:38.557587', 205, 2, 2, 4278, 1),
(4280, 'Pentru putin. La revedere!', '2019-07-04 07:56:38.567347', '2019-07-04 07:56:38.567347', 205, 2, 28, 4279, 0),
(4281, 'La revedere.', '2019-07-04 07:56:38.576131', '2019-07-04 07:56:38.576131', 205, 2, 28, 4280, 1),
(4282, 'Buna ziua! Ma numesc <NAMEBOT> si sunt aici sa te ajut.', '2019-07-04 07:56:38.595651', '2019-07-04 07:56:38.595651', 206, 2, 1, NULL, 0),
(4283, 'Ma poti ajuta cu o problema?', '2019-07-04 07:56:38.605410', '2019-07-04 07:56:38.605410', 206, 2, 2, 4282, 1),
(4284, 'Te ascult, <NAME>. Cu ce te pot ajuta?', '2019-07-04 07:56:38.614195', '2019-07-04 07:56:38.614195', 206, 2, 91, 4283, 0),
(4285, 'Unde as putea sa ma duc sa fac analize?', '2019-07-04 07:56:38.623955', '2019-07-04 07:56:38.623955', 206, 2, 41, 4284, 1),
(4286, 'Poti sa imi prezinti problema mai clar, te rog?', '2019-07-04 07:56:38.632739', '2019-07-04 07:56:38.632739', 206, 2, 91, 4285, 0),
(4287, 'Cred ca am ceva in neregula si vreau sa fac analize de sange.', '2019-07-04 07:56:38.641523', '2019-07-04 07:56:38.641523', 206, 2, 38, 4286, 1),
(4288, 'Ce fel de problema medicala ai?', '2019-07-04 07:56:38.650306', '2019-07-04 07:56:38.650306', 206, 2, 91, 4287, 0),
(4289, 'Imi e rau la orice mancare. Nu pot sa mananc.', '2019-07-04 07:56:38.660067', '2019-07-04 07:56:38.660067', 206, 2, 53, 4288, 1),
(4290, 'De cat timp ai aceasta problema?', '2019-07-04 07:56:38.668851', '2019-07-04 07:56:38.668851', 206, 2, 43, 4289, 0),
(4291, 'De ieri. Am inghitit ceva ce nu trebuia si de atunci imi e tot mai rau.', '2019-07-04 07:56:38.677634', '2019-07-04 07:56:38.677634', 206, 2, 53, 4290, 1),
