(4441, 'Am inteles. In cazul acesta, recomandarea mea ar fi un consult medical la clinica specializata clinicaxxxxx.', '2019-07-04 07:56:40.311139', '2019-07-04 07:56:40.311139', 212, 2, 11, 4440, 0),
