(4447, 'Imi pare rau, nu pot recomanda medicamente. Ce pot sa fac este sa te indrum catre o clinica specializta.', '2019-07-04 07:56:40.381945', '2019-07-04 07:56:40.381945', 212, 2, 73, 4446, 0),
