(4451, 'O zi usoara!', '2019-07-04 07:56:40.430744', '2019-07-04 07:56:40.430744', 212, 2, 28, 4450, 0),
(4452, 'Buna ziua! Ma numesc <NAMEBOT>. Cum te pot ajuta?', '2019-07-04 07:56:40.449288', '2019-07-04 07:56:40.449288', 213, 2, 1, NULL, 0),
(4453, 'Buna <NAMEBOT>. De cateva zile ma doare capul foarte tare.', '2019-07-04 07:56:40.470760', '2019-07-04 07:56:40.470760', 213, 2, 37, 4452, 1),
