(4535, 'Va multumesc, asa o sa fac.', '2019-07-04 07:56:41.340407', '2019-07-04 07:56:41.340407', 216, 2, 2, 4534, 1),
(4536, 'Multa sanatate! La revedere!', '2019-07-04 07:56:41.353095', '2019-07-04 07:56:41.353095', 216, 2, 28, 4535, 0),
(4537, 'Buna! Numele meu este <NAMEBOT>. In ce fel as putea sa te ajut?', '2019-07-04 07:56:41.369687', '2019-07-04 07:56:41.369687', 217, 2, 1, NULL, 0),
(4538, 'Am o durere la mana stanga. Cred ca mi-am sucit ceva la muschi. Ce imi sugerezi sa fac?', '2019-07-04 07:56:41.378471', '2019-07-04 07:56:41.378471', 217, 2, 46, 4537, 1),
(4539, 'De cat timp ai aceasta durere?', '2019-07-04 07:56:41.387255', '2019-07-04 07:56:41.387255', 217, 2, 48, 4538, 0),
(4540, 'Nu stiu, cateva minute. Speram sa imi treaca pana acum.', '2019-07-04 07:56:41.397015', '2019-07-04 07:56:41.397015', 217, 2, 2, 4539, 1),
(4541, 'Zona este umflata?', '2019-07-04 07:56:41.407752', '2019-07-04 07:56:41.407752', 217, 2, 48, 4540, 0),
(4542, 'Nu pare a fi umflata. Ce sa fac sau unde sa ma duc sa imi treaca?', '2019-07-04 07:56:41.418017', '2019-07-04 07:56:41.418017', 217, 2, 41, 4541, 1),
(4543, 'Pot sa iti recomand o vizita la clinicaxxxxx. Un medic generalist este mult mai capabil sa te ajute.', '2019-07-04 07:56:41.428752', '2019-07-04 07:56:41.428752', 217, 2, 11, 4542, 0),
(4544, 'Dar nu pot sa iau o crema sau ceva ca sa imi treaca mai repede?', '2019-07-04 07:56:41.438513', '2019-07-04 07:56:41.438513', 217, 2, 2, 4543, 1),
(4545, 'Este mult mai indicat sa consulti un medic specialist.', '2019-07-04 07:56:41.448273', '2019-07-04 07:56:41.448273', 217, 2, 73, 4544, 0),
(4546, 'Poti sa imi dai un articol care sa ma ajute?', '2019-07-04 07:56:41.459009', '2019-07-04 07:56:41.459984', 217, 2, 39, 4545, 1),
(4547, 'Pentru problema ta, poti consulta un articol de pe site-ul nostru: sitexxxxx', '2019-07-04 07:56:41.469745', '2019-07-04 07:56:41.469745', 217, 2, 12, 4546, 0),
(4548, 'Si acolo sunt recomandate medicamente? O crema, ceva?', '2019-07-04 07:56:41.483446', '2019-07-04 07:56:41.483446', 217, 2, 2, 4547, 1),
(4549, 'Cel mai indicat ar fi sa consulti un medic specializat.', '2019-07-04 07:56:41.493211', '2019-07-04 07:56:41.493211', 217, 2, 2, 4548, 0),
(4550, 'Nu vreau sa merg la doctor.', '2019-07-04 07:56:41.516592', '2019-07-04 07:56:41.516592', 217, 2, 2, 4549, 1),
(4551, 'Spune-mi daca te mai pot ajuta cu ceva.', '2019-07-04 07:56:41.527329', '2019-07-04 07:56:41.527329', 217, 2, 72, 4550, 0),
(4552, 'Nu. La revedere.', '2019-07-04 07:56:41.537089', '2019-07-04 07:56:41.537089', 217, 2, 26, 4551, 1),
(4553, 'La revedere, <NAME>!', '2019-07-04 07:56:41.547824', '2019-07-04 07:56:41.547824', 217, 2, 28, 4552, 0),
(4554, 'Buna! Numele meu este <NAMEBOT>. In ce fel as putea sa te ajut?', '2019-07-04 07:56:41.564921', '2019-07-04 07:56:41.564921', 218, 2, 1, NULL, 0),
(4555, 'Buna', '2019-07-04 07:56:41.574682', '2019-07-04 07:56:41.574682', 218, 2, 1, 4554, 1),
(4556, 'Cu ce te pot ajuta, <NAME>?', '2019-07-04 07:56:41.584442', '2019-07-04 07:56:41.584442', 218, 2, 91, 4555, 0),
(4557, 'Nu stiu cum sa iti explic.', '2019-07-04 07:56:41.593225', '2019-07-04 07:56:41.593225', 218, 2, 2, 4556, 1),
(4558, 'Asa cum poti, incearca sa imi explici care este problema.', '2019-07-04 07:56:41.602985', '2019-07-04 07:56:41.602985', 218, 2, 91, 4557, 0),
(4559, 'Imi este frica sa nu am o infectie de piele.', '2019-07-04 07:56:41.617625', '2019-07-04 07:56:41.617625', 218, 2, 64, 4558, 1),
(4560, 'Poti sa imi dai mai multe detalii, te rog?', '2019-07-04 07:56:41.627385', '2019-07-04 07:56:41.627385', 218, 2, 91, 4559, 0),
(4561, 'Ma mananca pielea si am puncte rosii.', '2019-07-04 07:56:41.637145', '2019-07-04 07:56:41.637145', 218, 2, 64, 4560, 1),
(4562, 'Ai fost la un medic pana acum?', '2019-07-04 07:56:41.646905', '2019-07-04 07:56:41.646905', 218, 2, 43, 4561, 0),
(4563, 'Nu inca. Nu am avut timp.', '2019-07-04 07:56:41.656665', '2019-07-04 07:56:41.656665', 218, 2, 2, 4562, 1),
(4564, 'Ai vreo reactie alergica la ceva?', '2019-07-04 07:56:41.667401', '2019-07-04 07:56:41.667401', 218, 2, 59, 4563, 0),
(4565, 'Sunt alergic la polen si peste, dar nu cred ca e o reactie alergica.', '2019-07-04 07:56:41.677161', '2019-07-04 07:56:41.677161', 218, 2, 64, 4564, 1),
(4566, 'De cat timp ai aceasta problema?', '2019-07-04 07:56:41.686921', '2019-07-04 07:56:41.686921', 218, 2, 43, 4565, 0),
(4567, 'Nu sunt sigur. A inceput sa ma manance de dimineata dar nu am observat punctele rosii.', '2019-07-04 07:56:41.697657', '2019-07-04 07:56:41.697657', 218, 2, 2, 4566, 1),
(4568, 'Mai ai si alte simptome?', '2019-07-04 07:56:41.709370', '2019-07-04 07:56:41.709370', 218, 2, 43, 4567, 0),
(4569, 'Nu chiar. Sunt doar mai frustrat de mancarimi.', '2019-07-04 07:56:41.718153', '2019-07-04 07:56:41.718153', 218, 2, 64, 4568, 1),
(4570, 'Ai incercat tratamente naturiste?', '2019-07-04 07:56:41.727913', '2019-07-04 07:56:41.727913', 218, 2, 42, 4569, 0),
(4571, 'Nu. Prefer sa iau medicamente de la farmacie.', '2019-07-04 07:56:41.737673', '2019-07-04 07:56:41.737673', 218, 2, 2, 4570, 1),
(4572, 'Tot pe acest subiect avem pe site unele articole care te-ar putea ajuta: sitexxxxx', '2019-07-04 07:56:41.747433', '2019-07-04 07:56:41.747433', 218, 2, 12, 4571, 0),
(4573, 'Multumesc, o sa ma uit dar acum ce pot sa fac sa nu ma mai manance?', '2019-07-04 07:56:41.757193', '2019-07-04 07:56:41.757193', 218, 2, 64, 4572, 1),
(4574, 'Cred ca trebuie sa te programezi la un dermatolog pentru un consult.', '2019-07-04 07:56:41.765977', '2019-07-04 07:56:41.765977', 218, 2, 47, 4573, 0),
(4575, 'Ma gandesc si eu la asta dar nu stiu unde sa ma duc.', '2019-07-04 07:56:41.775737', '2019-07-04 07:56:41.775737', 218, 2, 41, 4574, 1),
(4576, 'Ai propune sa mergi la clinicaxxxxx si sa ceri un consult.', '2019-07-04 07:56:41.785498', '2019-07-04 07:56:41.785498', 218, 2, 11, 4575, 0),
(4577, 'Mersi mult!', '2019-07-04 07:56:41.795258', '2019-07-04 07:56:41.795258', 218, 2, 2, 4576, 1),
(4578, 'Iti trimit si un voucher de reducere pentru analize (voucherxxxxx).', '2019-07-04 07:56:41.805017', '2019-07-04 07:56:41.805017', 218, 2, 50, 4577, 0),
(4579, 'Ok, multumesc', '2019-07-04 07:56:41.814777', '2019-07-04 07:56:41.814777', 218, 2, 2, 4578, 1),
(4580, 'Cu drag! Toate cele bune!', '2019-07-04 07:56:41.824537', '2019-07-04 07:56:41.824537', 218, 2, 28, 4579, 0),
(4581, 'Buna! Numele meu este <NAMEBOT>. In ce fel as putea sa te ajut?', '2019-07-04 07:56:41.842105', '2019-07-04 07:56:41.842105', 219, 2, 1, NULL, 0),
(4582, 'Ma ustura ochii si imi lacrimeaza non stop. Nu m-am frecat la ochi si nici n-am alergii.', '2019-07-04 07:56:41.852369', '2019-07-04 07:56:41.852369', 219, 2, 17, 4581, 1),
(4583, 'De cat timp ai avut aceasta problema?', '2019-07-04 07:56:41.862129', '2019-07-04 07:56:41.862129', 219, 2, 43, 4582, 0),
(4584, 'Azi a inceput.', '2019-07-04 07:56:41.871889', '2019-07-04 07:56:41.871889', 219, 2, 2, 4583, 1),
(4585, 'Urmezi un tratament?', '2019-07-04 07:56:41.880674', '2019-07-04 07:56:41.880674', 219, 2, 43, 4584, 0),
(4586, 'Nu, am crezut ca trece de la sine.', '2019-07-04 07:56:41.889457', '2019-07-04 07:56:41.889457', 219, 2, 2, 4585, 1),
(4587, 'Ochiul este rosu? Este iritat?', '2019-07-04 07:56:41.898242', '2019-07-04 07:56:41.898242', 219, 2, 85, 4586, 0),
(4588, 'Da, la ambele.', '2019-07-04 07:56:41.908001', '2019-07-04 07:56:41.908001', 219, 2, 61, 4587, 1),
(4589, 'Alte simptome ai?', '2019-07-04 07:56:41.916785', '2019-07-04 07:56:41.916785', 219, 2, 43, 4588, 0),
(4590, 'Nu am nici un alt simptom in afara de usturime si ca lacrimez.', '2019-07-04 07:56:41.926546', '2019-07-04 07:56:41.926546', 219, 2, 17, 4589, 1),
(4591, 'Cel mai indicat ar fi sa mergi la un medic oftalmolog pentru control.', '2019-07-04 07:56:41.935329', '2019-07-04 07:56:41.935329', 219, 2, 58, 4590, 0),
(4592, 'Unde pot sa ma duc?', '2019-07-04 07:56:41.944113', '2019-07-04 07:56:41.944113', 219, 2, 41, 4591, 1),
(4593, 'Vrei sa iti ofer o varianta de clinica?', '2019-07-04 07:56:41.952897', '2019-07-04 07:56:41.952897', 219, 2, 63, 4592, 0),
(4594, 'Da', '2019-07-04 07:56:41.961682', '2019-07-04 07:56:41.961682', 219, 2, 61, 4593, 1),
(4595, 'O solutie foarte buna pentru problema ta ar fi sa mergi la clinicaxxxxx.', '2019-07-04 07:56:41.970465', '2019-07-04 07:56:41.970465', 219, 2, 11, 4594, 0),
(4596, 'Cand pot sa ma duc?', '2019-07-04 07:56:41.980226', '2019-07-04 07:56:41.980226', 219, 2, 2, 4595, 1),
(4597, 'Orice detaliu se stabileste telefonic. Pot sa iti ofer un voucher, daca vrei?', '2019-07-04 07:56:41.989009', '2019-07-04 07:56:41.989009', 219, 2, 21, 4596, 0),
(4598, 'Voucher pentru ce?', '2019-07-04 07:56:42.000722', '2019-07-04 07:56:42.000722', 219, 2, 71, 4597, 1),
(4599, 'Voucherul iti ofera o reducere de pret la programare.', '2019-07-04 07:56:42.014385', '2019-07-04 07:56:42.014385', 219, 2, 19, 4598, 0),
(4600, 'Mi-ar prinde bine! Multumesc!', '2019-07-04 07:56:42.026098', '2019-07-04 07:56:42.026098', 219, 2, 61, 4599, 1),
(4601, 'Desigur, acesta este voucher-ul tau: voucherxxxxx', '2019-07-04 07:56:42.035859', '2019-07-04 07:56:42.035859', 219, 2, 50, 4600, 0),
(4602, 'Multumesc mult! Zi usoara!', '2019-07-04 07:56:42.050497', '2019-07-04 07:56:42.050497', 219, 2, 28, 4601, 1),
(4603, 'Multumesc, la fel! La revedere!', '2019-07-04 07:56:42.065137', '2019-07-04 07:56:42.065137', 219, 2, 28, 4602, 0),
(4604, 'Buna! Numele meu este <NAMEBOT>. Cu ce te pot ajuta?', '2019-07-04 07:56:42.084657', '2019-07-04 07:56:42.084657', 220, 2, 1, NULL, 0),
(4605, 'Salut!', '2019-07-04 07:56:42.095394', '2019-07-04 07:56:42.095394', 220, 2, 1, 4604, 1),
(4606, 'Incantata sa te cunosc, <NAME>. Care este problema?', '2019-07-04 07:56:42.106129', '2019-07-04 07:56:42.106129', 220, 2, 91, 4605, 0),
(4607, 'Am o mancarime de doua zile la picior. Cred ca este o iritatie.', '2019-07-04 07:56:42.116865', '2019-07-04 07:56:42.116865', 220, 2, 64, 4606, 1),
(4608, 'Ai alergii la ceva anume?', '2019-07-04 07:56:42.130529', '2019-07-04 07:56:42.130529', 220, 2, 59, 4607, 0),
(4609, 'Nu cred.', '2019-07-04 07:56:42.141265', '2019-07-04 07:56:42.141265', 220, 2, 2, 4608, 1),
(4610, 'De cat timp ai problema asta?', '2019-07-04 07:56:42.151025', '2019-07-04 07:56:42.151025', 220, 2, 43, 4609, 0),
(4611, 'Am zis, de doua zile.', '2019-07-04 07:56:42.162738', '2019-07-04 07:56:42.162738', 220, 2, 2, 4610, 1),
(4612, 'Mai ai si alte simptome in afara de ce mi-ai prezentat?', '2019-07-04 07:56:42.174450', '2019-07-04 07:56:42.174450', 220, 2, 43, 4611, 0),
(4613, 'Nu.', '2019-07-04 07:56:42.186162', '2019-07-04 07:56:42.186162', 220, 2, 26, 4612, 1),
(4614, 'Atunci iti recomand sa te vada un dermatolog.', '2019-07-04 07:56:42.196897', '2019-07-04 07:56:42.196897', 220, 2, 47, 4613, 0),
(4615, 'Bine atunci.', '2019-07-04 07:56:42.208610', '2019-07-04 07:56:42.209585', 220, 2, 61, 4614, 1),
(4616, 'Vrei sa iti recomand un centru medical?', '2019-07-04 07:56:42.222275', '2019-07-04 07:56:42.222275', 220, 2, 63, 4615, 0),
(4617, 'Sigur!', '2019-07-04 07:56:42.233009', '2019-07-04 07:56:42.233009', 220, 2, 61, 4616, 1),
(4618, 'O clinica potrivita pentru tine ar fi clinicaxxxxx.', '2019-07-04 07:56:42.242769', '2019-07-04 07:56:42.242769', 220, 2, 11, 4617, 0),
(4619, 'Bine, ma duc acolo maine.', '2019-07-04 07:56:42.251553', '2019-07-04 07:56:42.251553', 220, 2, 2, 4618, 1),
(4620, 'Vrei si voucher?', '2019-07-04 07:56:42.261313', '2019-07-04 07:56:42.261313', 220, 2, 21, 4619, 0),
(4621, 'La ce ma ajuta voucherul?', '2019-07-04 07:56:42.270097', '2019-07-04 07:56:42.270097', 220, 2, 71, 4620, 1),
(4622, 'Voucherul iti ofera reducere, mai multe informatii le poti afla la clinica.', '2019-07-04 07:56:42.279857', '2019-07-04 07:56:42.279857', 220, 2, 19, 4621, 0),
(4623, 'Nu multumesc. Nu cred ca ma mai duc.', '2019-07-04 07:56:42.288641', '2019-07-04 07:56:42.288641', 220, 2, 26, 4622, 1),
(4624, 'Ok, atunci pot sa iti recomand un articol de pe site-ul nostru, daca vrei.', '2019-07-04 07:56:42.298401', '2019-07-04 07:56:42.298401', 220, 2, 13, 4623, 0),
(4625, 'Da, te rog. Ce articol?', '2019-07-04 07:56:42.307185', '2019-07-04 07:56:42.307185', 220, 2, 61, 4624, 1),
(4626, 'Pe site-ul nostru poti gasi numeroase articole utile: sitexxxxx', '2019-07-04 07:56:42.316945', '2019-07-04 07:56:42.316945', 220, 2, 12, 4625, 0),
(4627, 'Ok mersi fain', '2019-07-04 07:56:42.325729', '2019-07-04 07:56:42.325729', 220, 2, 2, 4626, 1),
(4628, 'Cu drag. Iti urez insanatosire grabnica!', '2019-07-04 07:56:42.334513', '2019-07-04 07:56:42.334513', 220, 2, 28, 4627, 0),
(4629, 'Zi usoara!', '2019-07-04 07:56:42.344273', '2019-07-04 07:56:42.344273', 220, 2, 28, 4628, 1),
(4630, 'Buna! Ma numesc <NAMEBOT>. Cu ce te pot ajuta?', '2019-07-04 07:56:42.360865', '2019-07-04 07:56:42.360865', 221, 2, 1, NULL, 0),
(4631, 'Imi este foarte rau.', '2019-07-04 07:56:42.369649', '2019-07-04 07:56:42.369649', 221, 2, 2, 4630, 1),
(4632, 'Sunt aici sa te ajut, <NAME>. Poti sa imi descrii problema, te rog?', '2019-07-04 07:56:42.378433', '2019-07-04 07:56:42.378433', 221, 2, 91, 4631, 0),
(4633, 'Vomit, imi este greata si ma ia ameteala. Nu mai suport starea asta.', '2019-07-04 07:56:42.388193', '2019-07-04 07:56:42.388193', 221, 2, 27, 4632, 1),
(4634, 'Este posibil sa ai nevoie de un consult urgent la un medic generalist.', '2019-07-04 07:56:42.397953', '2019-07-04 07:56:42.397953', 221, 2, 44, 4633, 0),
(4635, 'Nu cred ca pot sa ies din casa. Imi este rau.', '2019-07-04 07:56:42.406737', '2019-07-04 07:56:42.406737', 221, 2, 66, 4634, 1),
(4636, 'Daca iti este dificil sa mergi pana la o clinica, ai cum sa ceri ajutor de la cineva sau sa chemi o ambulanta?', '2019-07-04 07:56:42.416497', '2019-07-04 07:56:42.416497', 221, 2, 74, 4635, 0),
(4637, 'Da, pot sa chem pe cineva.', '2019-07-04 07:56:42.429185', '2019-07-04 07:56:42.429185', 221, 2, 61, 4636, 1),
(4638, 'Perfect. Te mai pot ajuta cu ceva in momentul acesta?', '2019-07-04 07:56:42.438945', '2019-07-04 07:56:42.438945', 221, 2, 72, 4637, 0);
INSERT INTO `conversation_editor_chatline` (`id`, `message`, `created`, `updated`, `chat_id`, `created_user_id`, `label_id`, `parent_id`, `human`) VALUES
(4639, 'Da, ce medicament pot sa iau ca sa imi treaca greata?', '2019-07-04 07:56:42.448706', '2019-07-04 07:56:42.448706', 221, 2, 27, 4638, 1),
(4640, 'Nu am cum sa iti sugerez medicamente dar ca si tratament naturist iti propun zeama de lamaie sau ghimbie.', '2019-07-04 07:56:42.457993', '2019-07-04 07:56:42.457993', 221, 2, 54, 4639, 0),
(4641, 'Doar atat?', '2019-07-04 07:56:42.467753', '2019-07-04 07:56:42.467753', 221, 2, 18, 4640, 1),
(4642, 'Pentru ceva mai specific iti recomand sa vorbesti cu un medic specializat.', '2019-07-04 07:56:42.477513', '2019-07-04 07:56:42.477513', 221, 2, 73, 4641, 0),
(4643, 'Un aliment? Mancare? Un fruct?', '2019-07-04 07:56:42.487273', '2019-07-04 07:56:42.487273', 221, 2, 37, 4642, 1),
(4644, 'Ceai de ghimbir iti poate taia greata, insa cauza simptomelor trebuie cercetata de catre un medic specializat.', '2019-07-04 07:56:42.497033', '2019-07-04 07:56:42.497033', 221, 2, 54, 4643, 0),
(4645, 'Ok.', '2019-07-04 07:56:42.505817', '2019-07-04 07:56:42.505817', 221, 2, 61, 4644, 1),
(4646, 'Te mai pot ajuta cu ceva, <NAME>?', '2019-07-04 07:56:42.524361', '2019-07-04 07:56:42.524361', 221, 2, 72, 4645, 0),
(4647, 'Nu. M-ai ajutat mult cu asta. Multumesc.', '2019-07-04 07:56:42.535097', '2019-07-04 07:56:42.535097', 221, 2, 2, 4646, 1),
(4648, 'Cu placere! Multa sanatate iti doresc.', '2019-07-04 07:56:42.545834', '2019-07-04 07:56:42.545834', 221, 2, 28, 4647, 0),
(4649, 'O zi usoara!', '2019-07-04 07:56:42.556099', '2019-07-04 07:56:42.556099', 221, 2, 28, 4648, 1),
(4650, 'La revedere!', '2019-07-04 07:56:42.571715', '2019-07-04 07:56:42.571715', 221, 2, 28, 4649, 0),
(4651, 'Buna ziua! Sunt <NAMEBOT>. Sunt aici sa te ajut.', '2019-07-04 07:56:42.590259', '2019-07-04 07:56:42.590259', 222, 2, 1, NULL, 0),
(4652, 'Ma poti ajuta cu o problema?', '2019-07-04 07:56:42.601971', '2019-07-04 07:56:42.601971', 222, 2, 2, 4651, 1),
(4653, 'Ce problema medicala ai, <NAME>?', '2019-07-04 07:56:42.616611', '2019-07-04 07:56:42.617587', 222, 2, 91, 4652, 0),
(4654, 'Ma cam deranjeaza o ureche.', '2019-07-04 07:56:42.628323', '2019-07-04 07:56:42.628323', 222, 2, 69, 4653, 1),
(4655, 'Poti sa imi explici mai clar, te rog?', '2019-07-04 07:56:42.641011', '2019-07-04 07:56:42.641011', 222, 2, 91, 4654, 0),
(4656, 'Este mai mereu astupata, de parca este o presiune. Auzul imi este afectat cel mai mult.', '2019-07-04 07:56:42.651747', '2019-07-04 07:56:42.651747', 222, 2, 69, 4655, 1),
(4657, 'Aceasta problema persista de multa vreme?', '2019-07-04 07:56:42.662012', '2019-07-04 07:56:42.662012', 222, 2, 43, 4656, 0),
(4658, 'Nu sunt sigur.', '2019-07-04 07:56:42.671772', '2019-07-04 07:56:42.671772', 222, 2, 2, 4657, 1),
