(4786, 'S-ar putea ca pe site-ul nostru sa gasesti articole care abordeaza aceasta tema. Iti dau acest link pentru cand ai timp sa te uiti: sitexxxxx', '2019-07-04 07:56:43.974359', '2019-07-04 07:56:43.974359', 227, 2, 12, 4785, 0),
(4787, 'Mersi.', '2019-07-04 07:56:43.984119', '2019-07-04 07:56:43.984119', 227, 2, 2, 4786, 1),
(4788, 'Te mai pot ajuta cu ceva?', '2019-07-04 07:56:43.994855', '2019-07-04 07:56:43.994855', 227, 2, 72, 4787, 0),
(4789, 'Da, ce pot sa fac sa nu ma mai doara?', '2019-07-04 07:56:44.005591', '2019-07-04 07:56:44.005591', 227, 2, 18, 4788, 1),
(4790, 'Cred ca cel mai indicat ar fi sa consulti un medic pentru asta.', '2019-07-04 07:56:44.016327', '2019-07-04 07:56:44.016327', 227, 2, 73, 4789, 0),
(4791, 'Unde sa ma duc?', '2019-07-04 07:56:44.026087', '2019-07-04 07:56:44.026087', 227, 2, 41, 4790, 1),
(4792, 'Daca imi permiti, recomand sa iti faci o programare la clinicaxxxxx.', '2019-07-04 07:56:44.038304', '2019-07-04 07:56:44.038304', 227, 2, 11, 4791, 0),
(4793, 'Ma mai gandesc.', '2019-07-04 07:56:44.050992', '2019-07-04 07:56:44.050992', 227, 2, 2, 4792, 1),
(4794, 'Daca te intereseaza, pot sa iti ofer un voucher pentru reducere chiar acum.', '2019-07-04 07:56:44.063728', '2019-07-04 07:56:44.063728', 227, 2, 21, 4793, 0),
(4795, 'Da, multumesc.', '2019-07-04 07:56:44.074424', '2019-07-04 07:56:44.074424', 227, 2, 61, 4794, 1),
(4796, 'Acesta este voucher pentru clinicaxxxxx: voucherxxxxx . Sa iti fie de folos!', '2019-07-04 07:56:44.085152', '2019-07-04 07:56:44.085152', 227, 2, 50, 4795, 0),
(4797, 'Ah, multumesc!', '2019-07-04 07:56:44.097839', '2019-07-04 07:56:44.097839', 227, 2, 2, 4796, 1),
(4798, 'Cu drag!', '2019-07-04 07:56:44.108576', '2019-07-04 07:56:44.108576', 227, 2, 2, 4797, 0),
(4799, 'La revedere!', '2019-07-04 07:56:44.118336', '2019-07-04 07:56:44.118336', 227, 2, 28, 4798, 1),
(4800, 'La revedere, <NAME>!', '2019-07-04 07:56:44.128096', '2019-07-04 07:56:44.128096', 227, 2, 28, 4799, 0),
(4801, 'Buna ziua! <NAMEBOT> ma numesc si sunt aici sa te ajut.', '2019-07-04 07:56:44.147616', '2019-07-04 07:56:44.147616', 228, 2, 1, NULL, 0),
(4802, 'Am dureri articulare. Ma poti ajuta?', '2019-07-04 07:56:44.164208', '2019-07-04 07:56:44.164208', 228, 2, 56, 4801, 1),
(4803, 'Ai dureri cand mergi sau urci scari?', '2019-07-04 07:56:44.176896', '2019-07-04 07:56:44.176896', 228, 2, 23, 4802, 0),
(4804, 'Da. Scari nici nu mai pot sa urc din cauza genunchilor.', '2019-07-04 07:56:44.190088', '2019-07-04 07:56:44.190088', 228, 2, 25, 4803, 1),
(4805, 'De cat timp ai aceasta problema?', '2019-07-04 07:56:44.206680', '2019-07-04 07:56:44.206680', 228, 2, 43, 4804, 0),
(4806, 'De ani buni.', '2019-07-04 07:56:44.218392', '2019-07-04 07:56:44.218392', 228, 2, 2, 4805, 1),
(4807, 'Urmezi un tratament?', '2019-07-04 07:56:44.231080', '2019-07-04 07:56:44.231080', 228, 2, 43, 4806, 0),
(4808, 'Am incercat cu creme pentru reumatism dar tot ma doare.', '2019-07-04 07:56:44.245720', '2019-07-04 07:56:44.245720', 228, 2, 70, 4807, 1),
(4809, 'Poti sa imi spui ce varsta ai?', '2019-07-04 07:56:44.254504', '2019-07-04 07:56:44.254504', 228, 2, 43, 4808, 0),
(4810, 'Am 80 impliniti.', '2019-07-04 07:56:44.263287', '2019-07-04 07:56:44.263287', 228, 2, 2, 4809, 1),
(4811, 'Mai ai si alte simptome?', '2019-07-04 07:56:44.272071', '2019-07-04 07:56:44.272071', 228, 2, 43, 4810, 0),
(4812, 'Nu.', '2019-07-04 07:56:44.282807', '2019-07-04 07:56:44.282807', 228, 2, 26, 4811, 1),
(4813, 'Iti recomand sa mergi cat de curand la un medic reumatolog. Cu ajutorul lui vei putea scapa de durerile articulare.', '2019-07-04 07:56:44.291592', '2019-07-04 07:56:44.291592', 228, 2, 33, 4812, 0),
(4814, 'Doar atat pot sa fac?', '2019-07-04 07:56:44.301352', '2019-07-04 07:56:44.301352', 228, 2, 18, 4813, 1),
(4815, 'Noi avem si pe site articole care abordeaza aceasta problema: sitexxxxx', '2019-07-04 07:56:44.312088', '2019-07-04 07:56:44.312088', 228, 2, 12, 4814, 0),
(4816, 'Poti sa imi sugerezi un spital bun?', '2019-07-04 07:56:44.322824', '2019-07-04 07:56:44.322824', 228, 2, 41, 4815, 1),
(4817, 'Recomandarea mea ar fi sa mergi la clinicaxxxxx pentru un control.', '2019-07-04 07:56:44.332584', '2019-07-04 07:56:44.332584', 228, 2, 11, 4816, 0),
(4818, 'La clinicaxxxxx sunt preturi mari?', '2019-07-04 07:56:44.342343', '2019-07-04 07:56:44.342343', 228, 2, 87, 4817, 1),
(4819, 'Costul analizelor se discuta in momentul programarii. Dar, daca te-ar interesa, pot sa iti ofer un voucher de reducere. Te-ar interesa?', '2019-07-04 07:56:44.352104', '2019-07-04 07:56:44.352104', 228, 2, 21, 4818, 0),
(4820, 'Da! Multumesc mult.', '2019-07-04 07:56:44.362839', '2019-07-04 07:56:44.362839', 228, 2, 61, 4819, 1),
(4821, 'Acesta este voucher-ul tau (voucherxxxxx). Poti intreba in momentul programarii cum poti sa il folosesti.', '2019-07-04 07:56:44.374552', '2019-07-04 07:56:44.374552', 228, 2, 50, 4820, 0),
(4822, 'Am inteles. Mersi!', '2019-07-04 07:56:44.384312', '2019-07-04 07:56:44.384312', 228, 2, 2, 4821, 1),
(4823, 'Cu drag. La revedere!', '2019-07-04 07:56:44.393127', '2019-07-04 07:56:44.393127', 228, 2, 28, 4822, 0);
